import './App.css';
import {Component} from "react";
import Stack from '@mui/material/Stack';
import Button from '@mui/material/Button';
import Input from '@mui/material/Input';

const ariaLabel = { 'aria-label': 'description' };

class App extends Component {
  state = {
    items: []
  };

  async componentDidMount() {
    const response = await fetch('http://localhost:8081/api/product/all');
    const body = await response.json();
    this.setState({items: body});
  }

  render() {
    const {items} = this.state;
    return (
        <div className="App">
          <h1>Item List</h1>
            {items.map(item =>
                <div key={item.id}>
                  Name: <Input disabled defaultValue={item.name} inputProps={ariaLabel} />  Description: <Input disabled defaultValue={item.description} inputProps={ariaLabel} /> <Button variant="contained">Contained</Button> <Button variant="contained">Contained</Button> <Button variant="contained">Contained</Button>
                </div>
            )}
        </div>
    );
  }
}
export default App;
